const styles = {

    description: {
        color: '#6C6C80',
        fontSize: 16,
        marginTop: 10,
        fontFamily: 'Roboto_400Regular',
        maxWidth: 260,
        lineHeight: 24,
        marginLeft: 150,
        marginBottom: 20,
    },

    main: {
        flex: 1,
        justifyContent: 'center'
    },

    title: {
        color: '#322153',
        fontSize: 20,
        fontFamily: 'Ubuntu_700Bold',
        maxWidth: 260,
        marginTop: -100,
        marginLeft: 50,
        marginBottom: 20,
    },
}

export default styles;
